import React from "react";
import "./product.css";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";

function product() {
  return (
    <div className="product">
      <div className="product_info">
        <p>Ipad Pro 64 GB</p>
        <p className="proct_price">
          <small>$</small>
          <strong>19.99</strong>
        </p>
        <div className="product_rating">
          <p>⭐⭐⭐⭐</p>
        </div>
      </div>
      <img src="https://m.media-amazon.com/images/I/71SAHzzQqkL._SL1500_.jpg" />
      <button>
        Add to Basket <ShoppingCartIcon />
      </button>
    </div>
  );
}

export default product;
